import styled from 'styled-components'
const TopHeadline = () => {
    const Headline=styled.div`
    font-size:1rem;
    `;
  return (
    <Headline>
    <div><p>For any Queries With Your Order Mail Us At kermitcard@gmail.com</p></div>
    </Headline>
  )
}

export default TopHeadline
